description:
Bán nhà phố Nhật Chiêu, Nhật Tân, ngõ thoáng đãng, ô tô đỗ cửa, thông thằng ra Lạc Long Quân, Hồ Tây. Khu vực cực kì thuận tiện vào phố cổ 15 phút, ba phút hồ Tây;
Nhà mới xây được ba năm, có thể đi vào từ nhiều hướng, vị trí lô góc nên thành ba thoáng, phòng nào cũng tràn ngập ánh sáng, ban ngày cơ bản không cần bật điện;
Từ nhà có thể đi bộ ra trường C2 Nhật Tân chỉ 5p, cực kỳ thuận tiền.
Sổ đẹp như khuôn, nở hậu, rất vượng khí.

